import { useState, useEffect } from "react";

export default function HomePageView() {
  const [meme, setMeme] = useState({});

  useEffect(() => {
    fetch("https://www.reddit.com/r/memes.json")
      .then((res) => res.json())
      .then((body) => {
        // console.log(body);
        setMeme(body.data.children);
      });
  }, []);
  console.log(meme);

  const memeToDisplay = () => {
      if(meme) {
          meme.map((m)=> {
              return(
                  <h1>{m.data.title}</h1>
              )
          })
      }
  }

  return (
    <div className="container">
      {/* {meme.map((d) => {
        return <h1>{d.data.title}</h1>;
      })} */}
    </div>
  );
}
